package com.example.karnor.utils

import com.example.karnor.model.Pdf
import com.example.karnor.repository.PdfRepo
import org.springframework.stereotype.Component
import jakarta.annotation.PostConstruct
import java.util.Base64

@Component
class DataSeeder(val pdfRepo: PdfRepo) {

    fun seedData() {
        // Base64 string of the PDF file
        val base64Pdf = ""
        // Example Base64 string

        // Decode the Base64 string into a ByteArray
        val pdfData = Base64.getDecoder().decode(base64Pdf)

        // Check if the PDF with the same name already exists
        val existingPdf = pdfRepo.findByFileName("ST.pdf")

        if (existingPdf == null) {
            // Create a new Pdf entity with decoded PDF data
            val pdf = Pdf(null, "ST.pdf", pdfData)
            pdfRepo.save(pdf)
            println("PDF has been seeded into the database!")
        } else {
            println("PDF already exists, skipping seeding.")
        }
    }
}
